func minOperations(nums1 []int, nums2 []int) int {
    swaps := 0
    maxIndex1, maxIndex2 := 0, 0

    // Find indexes of maximum values in nums1 and nums2
    for i, val := range nums1 {
        if val > nums1[maxIndex1] {
            maxIndex1 = i
        }
    }
    for i, val := range nums2 {
        if val > nums2[maxIndex2] {
            maxIndex2 = i
        }
    }

    // Swap to make nums1[n-1] the maximum of nums1 if it's not already
    if nums1[len(nums1)-1] < nums1[maxIndex1] {
        nums1[maxIndex1], nums2[maxIndex1] = nums2[maxIndex1], nums1[maxIndex1]
        swaps++
    }

    // Swap to make nums2[n-1] the maximum of nums2 if it's not already
    if nums2[len(nums2)-1] < nums2[maxIndex2] {
        nums1[maxIndex2], nums2[maxIndex2] = nums2[maxIndex2], nums1[maxIndex2]
        swaps++
    }

    // After swapping, check if the conditions are satisfied
    if nums1[len(nums1)-1] != maxVal(nums1) || nums2[len(nums2)-1] != maxVal(nums2) {
        return -1 // It's impossible to satisfy the conditions
    }
    return swaps
}

func maxVal(nums []int) int {
    max := nums[0]
    for _, v := range nums {
        if v > max {
            max = v
        }
    }
    return max
}
